import React from "react";

const Card = (props) => {
  const { foodName, imgSrc, options, price } = props;

  const priceOptions = Object.keys(options);

  return (
    <div>
      <div className="card mt-3" style={{ width: "18rem" }}>
        <img src={imgSrc} className="card-img-top w-100 h-100" alt={foodName} />
        <div className="card-body">
          <h5 className="card-title">{foodName}</h5>
          <div className="container w-100 d-flex align-items-center">
            <select className="m-2 h-100 bg-success text-white">
              {Array.from(Array(6), (x, i) => (
                <option key={i + 1} value={i + 1}>
                  {i + 1}
                </option>
              ))}
            </select>

            <select className="m-2 h-100 bg-success text-white rounded">
              {priceOptions.map((data) => (
                <option value={data} key={data}>
                  {data}
                </option>
              ))}
            </select>

            <div className="h-100 fs-5">Total Price</div>
          </div>
          <button className="btn btn-success m-2 w-100">Add to Cart</button>
        </div>
      </div>
    </div>
  );
};

export default Card;
